The Book We added previously cuicui_dsl, cuicui_layout, and cuicui_layout_bevy_ui to our Cargo.toml. Now let's write some rust code. We first import the relevant stuff: use bevy::prelude::*;
use cuicui_dsl::{dsl, EntityCommands};
use cuicui_layout::{dsl_functions::*, LayoutRootCamera};
use cuicui_layout_bevy_ui::UiDsl; Then, we initialize the bevy app, all standard bevy stuff. fn main() { App::new() .add_plugins(( DefaultPlugins, // Notice that we add the plugin here. cuicui_layout_bevy_ui::Plugin, )) .add_systems(Startup, setup) .run();
} Now we want to spawn the UI. Our UI will be a single menu with 7 buttons, each with a different text. The buttons and menu all have a background, so we need a Res<AssetServer>. fn setup(mut cmds: Commands, serv: Res<AssetServer>) { cuicui_layout uses the LayoutRootCamera component to resize layouts based on the viewport size. So let's spawn the camera with it: cmds.spawn((Camera2dBundle::default(), LayoutRootCamera)); Now let's spawn the menu. The methods available on UiDsl are listed on docs.rs. Since UiDsl by default Deref<Target=LayoutDsl>, the methods on LayoutDsl are also available. We want: A column menu with the board.png background offset from the left edge of the screen by 100 pixels. This column contains a large logo.png and a smaller one, it also contains 7 buttons. We would want some margin between the edges of the screen and the content of the coulmn, also between the button and the edge of the column. Let's first start by setting up the column. We define the handles outside of the dsl! macor, for clarity: let title_card = serv.load("logo.png"); let bg = serv.load("background.jpg"); let board = serv.load("board.png"); Then we build the menu. We use the dsl! macro. As first parameter we specify the DSL we want to use, here we use UiDsl from cuicui_layout_bevy_ui, that we imported earlier. Then, we pass a &mut EntityCommands, which we create by using Commands::spawn_empty Finally, we start the definition of the UI scene. dsl! { <UiDsl> &mut cmds.spawn_empty(), The first container should have a ScreenRoot component, so that it always has the same size as the viewport with the LayoutRootCamera component. In the LayoutDsl, you add the screen root component by calling the LayoutDsl::screen_root method. Root(screen_root row distrib_start image(&bg)) { We use row , because the root node is not the column, it is the "screen", the container that will hold the column, and we want to position the column relative to the left side of the screen. Speaking of which, we use distrib_start , so that the the first object is placed to the left of the container, the "start" of the distribution zone. The image(&bg) is the UiDsl::image method, we pass to it the handle to the "background.jpg" image. If you have the example code open in your IDE, you should be able to click on individual methods in the dsl! macro and jump to their source or see their documentation. We name the node Root, so that it's easier to identify it using bevy-inspector-egui. Let's see the result: Root(screen_root row distrib_start image(&bg)) { Column(column image(&board))
} How the menu looks like currently Now let's add the two logo images to the column. Root(screen_root row distrib_start image(&bg)) { Column(column image(&board)) { TitleCard(image(&title_card)) TitleCard2(image(&title_card)) }
} The main menu, with the column, but it is way too large and overflows the screen size Ooops. Something bad happened here! Interestingly, cuicui_layout printed an error message. It noticed that the column overflowed its container. The error is: ERROR bevy_mod_sysfail: Node Root's width is overflowed by its children!
Notes:
- Root's inner size (excluding margins) is 640Ã—360
- There are 1 children of total width 877.5px.
- The largest child is Column So far, it doesn't teach us anything that we didn't knowâ€¦

