The best way to diagnose this kind of errors is to set rules on the size of the responsible nodes. Rule s in cuicui_layout are size constraints on layout nodes. You can set rules on width and height independently. In the LayoutDsl DSL, you set constraints through width , height , or both at the same time with rules . The size of a container may be: Fixed (using px(pixels)): it is set to a specific number of pixels. Child-relative (using child(ratio)): The container size is equal to it's children's size on that axis TIMES ratio PLUS twice the margin of that axis (more on margins later). Parent-relative (using pct(percent)): it is set to a given percent of it's parent inner size [1] . So here, we know that Column is too large for Root. So let's limit its width to 100 pixels. We also want the column to span the whole height of the screen, so we will set its height to pct(100). Root(screen_root row distrib_start image(&bg)) { Column(column width(px(100)) height(pct(100)) image(&board)) { TitleCard(image(&title_card)) TitleCard2(image(&title_card)) }
} Let's see the result: The main menu, with the column, but the images are still too large We now see the whole column, but the logos are still way too large. We get a new error message: ERROR bevy_mod_sysfail: Node Column's width is overflowed by its children!
Notes:
- Column's inner size (excluding margins) is 100Ã—360
- There are 2 children of total width 585px.
- The largest child is TitleCard2 In the previous error message, the total width of column was 877.55px, in this, it is 100px, as we expected, but the children's width is 585px, which is larger than 100 since last time I checked. As a hint. Before we specified the size of Column, its rules were the default. The default rule for containers is child(1.5) (585 * 1.5 = ???).

