For the buttons, we will need text. This is a UiDsl method, UiDsl::text . We also want to use button.png as background for our buttons. We loaded it using let button_bg = serv.load("button.png"). So let's proceed: Root(screen_root row distrib_start main_margin(50.) image(&bg)) { Column(column rules(px(100), pct(100)) main_margin(10.) image(&board)) { TitleCard(width(pct(100)) image(&title_card)) TitleCard2(width(pct(50)) image(&title_card)) Entity(image(&button_bg) width(pct(80)) text("CONTINUE")) Entity(image(&button_bg) width(pct(80)) text("NEW GAME")) Entity(image(&button_bg) width(pct(80)) text("LOAD GAME")) Entity(image(&button_bg) width(pct(80)) text("SETTINGS")) Entity(image(&button_bg) width(pct(80)) text("ADDITIONAL CONTENT")) Entity(image(&button_bg) width(pct(80)) text("CREDITS")) Entity(image(&button_bg) width(pct(80)) text("QUIT GAME")) }
} Main menu with buttons No errors! But very very ugly. Like wow: The column stretches to the whole screen, it makes the layout bottom hevy "ADDITIONAL CONTENT" height is twice as large as the other buttons, breaking the harmony. The code itself is ugly, we got a lot of repeating code. Well, on the estethic side, we can't do much with those assets, but we can set the fixed width of the column to 150 pixels instead of 100. For code quality, we use an abstraction. Let's define a function: fn button(cmds: &mut EntityCommands, button_bg: &Handle<Image>, button_text: &'static str) { dsl! { <UiDsl> cmds, Entity(text(button_text) named(button_text) image(button_bg) width(pct(80))) }
} Don't try to convert it into a closure! Rust's type system can't handle closures that accepts references of different lifetimes, and this will cause a lot of cryptic error messages. Now, let's use the the code statement to call that function: Root(screen_root row distrib_start main_margin(50.) image(&bg)) { Column(column rules(px(150), pct(100)) main_margin(10.) image(&board)) { TitleCard(width(pct(100)) image(&title_card)) TitleCard2(width(pct(50)) image(&title_card)) code(let cmds) { button(cmds, &button_bg, "CONTINUE") } code(let cmds) { button(cmds, &button_bg, "NEW GAME") } code(let cmds) { button(cmds, &button_bg, "LOAD GAME") } code(let cmds) { button(cmds, &button_bg, "SETTINGS") } code(let cmds) { button(cmds, &button_bg, "ADDITIONAL CONTENT") } code(let cmds) { button(cmds, &button_bg, "CREDITS") } code(let cmds) { button(cmds, &button_bg, "QUIT GAME") } }
} Not that much better reallly! But what are we looking at? code statements allow you to inline rust code within the dsl! macro. What if instead we defined the button names in a list and use a for loop inside the code statement? let menu_buttons = [ "CONTINUE", "NEW GAME", "LOAD GAME", "SETTINGS", "ADDITIONAL CONTENT", "CREDITS", "QUIT GAME", ]; Root(screen_root row distrib_start main_margin(50.) image(&bg)) { Column(column rules(px(150), pct(100)) main_margin(10.) image(&board)) { TitleCard(width(pct(100)) image(&title_card)) TitleCard2(width(pct(50)) image(&title_card)) code(let cmds) { for text in menu_buttons { button(cmds, &button_bg, text) } } }
} Main menu, but only the "QUIT GAME" button exists Well, that's bad. What happened? If you have the code open in your text editor, look at the type of cmds in let cmds. Can you guess why this is happening? You'll notice it is an &mut EntityCommands. What we are doing in that for loop is insert over and over our UiDsl on the same entity. This is why we end up with a single button. cuicui_dsl passes &mut EntityCommands to code blocks because as a rule, the cuicui DSL only allows a single entity per statement. But this doesn't solve our problem, how would we spawn seven buttons with a for loop? The answer is to: Spawn a container for the buttons Spawn the buttons within that container code(let cmds) { dsl! { <UiDsl> cmds, ButtonContainer(column rules(pct(100), pct(60))) }; cmds.with_children(|cmds| { for text in menu_buttons { button(&mut cmds.spawn_empty(), &button_bg, text); } }); } All the buttons are in the menu, but they are distributed unevenly We got back our seven buttons! The code did end up a bit more complex than the initial repeating code, but if your layout gets complex, this way of abstracting can get handy. So to finish it up, we still need to add some "empty space" at the bottom of the column and some margin for the logo. The final result: let menu_buttons = [ "CONTINUE", "NEW GAME", "LOAD GAME", "SETTINGS", "ADDITIONAL CONTENT", "CREDITS", "QUIT GAME", ]; let button_bg = serv.load("button.png"); let title_card = serv.load("logo.png"); let bg = serv.load("background.jpg"); let board = serv.load("board.png"); dsl! { <UiDsl> &mut cmds.spawn_empty(), Root(screen_root row distrib_start main_margin(50.) image(&bg)) { Column(image(&board) rules(px(150), pct(100)) main_margin(10.) column) { TitleCard(width(pct(100)) image(&title_card)) TitleCard2(width(pct(50)) ui(title_card)) code(let cmds) { dsl! { <UiDsl> cmds, ButtonContainer(column rules(pct(100), pct(60))) }; cmds.with_children(|cmds| { for text in menu_buttons { button(&mut cmds.spawn_empty(), &button_bg, text); } }); } BottomSpacer(height(pct(15))) } } }; Main menu with balanced button distribution Woohoo! Time to treat yourself. Next, we will do this using cuicui_chirp and the chirp language. The main axis is the axis of direction of the container. For a row container, the main axis is the x axis. For a column container, it is the y axis. The cross axis is the axis perpendicular to the corss axis (so y for row containers and x for column containers) The "Inner size" is the size of a node deduced its margins on a given axis. It's the effective size children can occupy, so we use that for percentage.

