diplomacy_menu!()(hidden) Indeed, we don't want all three menus to be visible at the same time. To this end, we spawn the production and diplomacy menus with the Visibility component set to Hidden. But here is the hang up! Neither LayoutDsl or UiDsl have a hidden method, how are we to set the Visibility component? Answer: We write our own DSL. Let's start by creating a new module: mod dsl; Then define a BetterFactorioDsl: // `DslBundle` requires `Default`
#[derive(Default)]
pub struct BetterFactorioDsl { inner: UiDsl, is_hidden: bool,
} Let's add the chirp loader for BetterFactorioDsl in our add_plugins: cuicui_chirp::loader::Plugin::new::<BetterFactorioDsl>(), We need to implement ParseDsl and DslBundle on BetterFactorioDsl for this to compile. The parse_dsl_impl macro is how we implement ParseDsl. We use the delegate meta-attribute, so that we can re-use the UiDsl and LayoutDsl methods in our chirp file: #[parse_dsl_impl(delegate = inner)]
impl BetterFactorioDsl {} impl DslBundle for BetterFactorioDsl { fn insert(&mut self, cmds: &mut EntityCommands) -> Entity { self.inner.insert(cmds) }
} It compiles now, but we are missing the hidden method: Error: Ã— No 'hidden' method â•­â”€[better_factorio/menu.chirp:65:1] 65 â”‚ game_menu!() 66 â”‚ production_menu!()(hidden) 67 â”‚ diplomacy_menu!()(hidden) Â· ^^^^^^ 68 â”‚ } â•°â”€â”€â”€â”€ help: custom_dsl::dsl::BetterFactorioDsl doesn't contain a method with this name. Let's add it then! We already have a is_hidden field, we just have to define a hidden method to set it: impl BetterFactorioDsl { fn hidden(&mut self) { self.is_hidden = true; } Now we can read the is_hidden field in the DslBundle::insert implementation: let id = self.inner.insert(cmds); if self.is_hidden { cmds.insert(Visibility::Hidden); } id Make sure to add it after the inner.insert(cmds). Visibility is part of the NodeBundle that UiDsl adds to the entity. Adding it after the inner ensures that we overwrite the Visibility component with the wanted value.

