We will use the bevy_mod_picking components for this. We should use the On component from bevy_mod_picking. One issue with On is that it is not Reflect , therefore, we cannot use it in our chirp file; cuicui_chirp creates a scene then adds it to the bevy world, and this requires all components from the scene to be Reflect. cuicui_dsl doesn't have this issue. We can get around this limitation by creating a "mirror" component. Mirror components are Reflect proxies that are synchronized with actual components. We already define a MirrorPlugin in the cuicui_examples shared code. I plan on extracting this into a standalone crate, cuicui_mirror. All we have left to do is to define a mirror component, implement From<&ReflectOnClick> for On<Pointer<Click>>, and add MirrorPlugin. use bevy::prelude::{info, Component, EventWriter, Reflect, ReflectComponent};
use bevy_mod_picking::prelude::{Click, On, Pointer}; use crate::dsl::{SwitchGraph, SwitchTab}; #[derive(Reflect, Default, Component)]
#[reflect(Component)]
pub enum ReflectOnClick { LogInfo(String), EmitSwitchTab(u8), EmitSwitchGraph(u8), #[default] Invalid,
}
type OnClick = On<Pointer<Click>>; impl<'a> From<&'a ReflectOnClick> for OnClick { fn from(value: &'a ReflectOnClick) -> Self { match value { ReflectOnClick::LogInfo(text) => { let text = text.clone(); OnClick::run(move || info!("{text}")) } &ReflectOnClick::EmitSwitchTab(index) => { OnClick::run(move |mut ev: EventWriter<_>| ev.send(SwitchTab(index))) } &ReflectOnClick::EmitSwitchGraph(index) => { OnClick::run(move |mut ev: EventWriter<_>| ev.send(SwitchGraph(index))) } ReflectOnClick::Invalid => unreachable!("Should never spawn an invalid ReflectOnClick"), } }
} bevy_mod_picking::DefaultPickingPlugins, cuicui_examples::MirrorPlugin::<OnClick, ReflectOnClick>::new_from(), Now let's amend BetterFactorioDsl to add the highlight and print_text methods: #[derive(Default)]
pub struct BetterFactorioDsl { inner: UiDsl, is_hidden: bool,
+ is_highlight: bool,
+ text_to_print: Option<Box<str>>,
} In the #[parse_dsl_impl] impl BetterFactorioDsl block: fn print_text(&mut self, text: &str) { self.text_to_print = Some(text.into()); } fn highlight(&mut self) { self.is_highlight = true; } In DslBundle::insert for BetterFactorioDsl: if let Some(text) = self.text_to_print.take() { cmds.insert(ReflectOnClick::LogInfo(text.into())); } if self.is_highlight { cmds.insert(Highlight::new(Color::BEIGE)); } I'll skip over Highlight here, you can see the implementation for yourself . Similarly to ReflectOnClick, we use bevy_mod_picking to react to events, but define it as a standalone Reflect component to be able to use it in a scene. A mouse cursor moving over buttons that change color when they are hovered (not shown: the logs in the terminal)

