Behind the veil The dsl! macro is basically a way to translate an imperative sequential API into a declarative functional API. When you write: # use cuicui_dsl::macros::__doc_helpers::*; // ignore this line pls
use cuicui_dsl::dsl;
# fn sys(mut cmds: EntityCommands) {
dsl! { <BlinkDsl> &mut cmds, Root { FastBlinker(frequency(0.5)) SlowBlinker(amplitude(2.) frequency(3.0)) }
}
# } The dsl! macro translates it into: # use cuicui_dsl::macros::__doc_helpers::*; // ignore this line pls
# fn sys(mut cmds: EntityCommands) {
let mut root = BlinkDsl::default();
root.named("Root");
root.node(&mut cmds, |cmds| { let mut fast_blinker = BlinkDsl::default(); fast_blinker.named("FastBlinker"); fast_blinker.frequency(0.5); fast_blinker.insert(&mut cmds.spawn_empty()); let mut slow_blinker = BlinkDsl::default(); slow_blinker.named("SlowBlinker"); slow_blinker.amplitude(2.); slow_blinker.frequency(3.0); slow_blinker.insert(&mut cmds.spawn_empty());
});
# } The DslBundle::insert impl of BlinkDsl takes care of converting itself into a set of components it will insert on an entity. See the dsl! documentation for more details and examples. Inheritance The cuicui crates compose different DslBundles with a very filthy trick. Using DerefMut, you can get both the methods of your custom DslBundle and the methods of another DslBundle embedded into your custom DslBundle (and this works recursively). Use the bevy Deref and DerefMut derive macros to accomplish this: # use cuicui_dsl::macros::__doc_helpers::*; // ignore this line pls
use cuicui_dsl::DslBundle; // `= ()` means that if not specified, there is no inner DslBundle
#[derive(Default, Deref, DerefMut)]
pub struct MyDsl<D = ()> { #[deref] inner: D, style: Style, bg_color: Color, font_size: f32,
}
impl<D: DslBundle> DslBundle for MyDsl<D> { fn insert(&mut self, cmds: &mut EntityCommands) -> Entity { cmds.insert(self.style.clone()); // ... other components to insert ... // Always call the inner type at the end so that insertion order follows // the type declaration order. self.inner.insert(cmds) }
}
// Both the methods defined on `MyDsl`
// and the provided `D` are available in the `dsl!` macro for `<MyDsl<D>>` Performance The downside of the aforementioned trick is the size of your DslBundles. Very large DslBundles tend to generate a lot of machine code just to move them in and out of functions. Try keeping the size of your DslBundles down using bitsets crates such as enumset or bitflags instead of bool fields. Consider also Boxing some large components such as Style to avoid the cost of moving them. Storing a dynamic set of bundles in your DslBundle If you are a lazy butt like me, you don't need to add a field per bundles/component managed by your DslBundle, you can store a Vec of bundle spawners as follow: # use cuicui_dsl::macros::__doc_helpers::*; // ignore this line pls
use cuicui_dsl::{EntityCommands, DslBundle}; #[derive(Default)]
pub struct MyDynamicDsl(Vec<Box<dyn FnOnce(&mut EntityCommands)>>); impl MyDynamicDsl { pub fn named(&mut self, name: &str) { let name = name.to_string(); self.0.push(Box::new(move |cmds| {cmds.insert(Name::new(name));})); } pub fn transform(&mut self, transform: Transform) { self.0.push(Box::new(move |cmds| {cmds.insert(transform);})); } pub fn style(&mut self, style: Style) { self.0.push(Box::new(move |cmds| {cmds.insert(style);})); } // ... Hopefully you get the idea ...
}
impl DslBundle for MyDynamicDsl { fn insert(&mut self, cmds: &mut EntityCommands) -> Entity { for spawn in self.0.drain(..) { spawn(cmds); } cmds.id() }
}

