The basic syntax is similar to the cuicui_dsl dsl! macro. One major difference is that code blocks are replaced with a function registry. You can register a function using the WorldHandles resource. Registered functions are global to all chirp files loaded using cuicui_chirp. The other differences are the addition of import statements (use), template definitions (fn), and template calls (template!()). Import statements They are currently not implemented, so please proceed to the next section. Draft design Note Imports ARE NOT IMPLEMENTED In cuicui_chirp you are not limited to a single file. You can import other chirp files. To do so, use an import statement. Import statements are the first statements in the file ; They start with the use keyword, are followed by the source path of the file to import and an optional "as imported_name", this is the name with which the import will be refered in this file. use different/file
// ... You have two ways to use imports: As whole file imports . You can import any file and directly use it as if it was a template without parameters. This is useful if you want to compose several complex menus you write in different files. As template collections . You can import individual templates defined in a file. Just complete the path with a .template_name. Similarly to rust, you can combine imports, but only templates from the same file, so the following is valid: use different/file.template
use different/file.{template1, template2}
